from collections import Counter

def Most_Freq_Kmer(text, k):
    # arr = []
    l = Counter([text[i:i+k] for i in range(len(text)-k+1)]).most_common()
    ans = []
    most = l[0][1]
    for i in l:
        if i[1] != most:
            break
        ans.append(i[0])
    return ans

text = 'ACGTTGCATGTCGCATGATGCATGAGAGCT'
k = 4
# text = ''
# k = 12
print(' '.join(Most_Freq_Kmer(text, k)))

